message:
/* Demographic landscape of Bangladesh before partition */Corrected as per citation. Hindus 28% & Muslims 70.3%.
Total population is 39.12 million. So 70.3% of 39.12 million gives the population of 27.5 million for muslims & 28% of 39.12 million gives the population result of 10.95 million for hindus.

Hence revised.
